import React, { Component, Fragment } from 'react';
import Rota from './ComponentRota';

class ComponentCardPrincipal extends Component {

   render() {
      return (
         <Fragment>
            {/* <!--INICIO CARD PRINCIPAL--> */}
            <div className="card" style={{ marginBottom:30+"px" }}>
               {/* <!--TITULO CARD PRINCIPAL--> */}
               <div className="card-header text-center" style={{ backgroundColor: '#33cc33', color: 'black' }}
                  data-toggle="collapse" data-target={ "#" + this.props.titulo} aria-controls={this.props.titulo}>
                  <h2 className="font-weight-bold">{this.props.titulo}</h2>
               </div>

               <div id={this.props.titulo} className="collapse" data-parent="#outterAccordion">
                  {/* <!--CORPO CARD PRINCIPAL--> */}
                  <div className="card-body">
                     <div id="accordion">


                        <Rota titulo='Criar' metodo='get' rota="/usuario" json={{ nome: "Chimbinha Gomes", email: "chimbinha@gmail.com", senha: "amo_a_joelma_123" }} />
                        <Rota titulo='Criar' metodo='get' rota="/usuario" json={{ nome: "Chimbinha Gomes", email: "chimbinha@gmail.com", senha: "amo_a_joelma_123" }} />
                     </div>
                  </div>
               </div>
            </div>
            {/* <!--FIM CARD PRINCIPAL--> */}
         </Fragment>
      );
   }

}

export default ComponentCardPrincipal;
